import React, { Component } from 'react';
import SplitText from 'react-pose-text';
import './Home.css';

const charPoses = {
        exit: { opacity: 0, y: 20 },
        enter: {
            opacity: 1,
            y: 0,
            delay: ({ charIndex }) => charIndex * 400
        }
    };

class Home extends Component {
render() {
    return (
        <div>
            <video autoplay="autoplay" loop="loop" muted className="Video">
                <source src={require('./dudu.mp4')} type="video/mp4"/>
            </video>
            <div className='caption' align='center'>
                <SplitText  initialPose="exit" pose="enter" charPoses={charPoses}>Breakfast</SplitText>
            </div>


            <footer className='home-footer' align="center">@BKF2020 by Stadler Raphael</footer>


        </div>

    );
}
}

export default Home;
